import Link from "next/Link";
import styled from "styled-components";
import Nav from "./Nav";
export default function Header() {
  const Logo = styled.h1`
    background: red;
    margin-left: 2rem;
    position: relative;
    z-index: 2;
    font-size: 4rem;
    a {
      color: #ffffff;
    }
  `;
  return (
    <header>
      <div className="bar">
        <Logo>
          <Link href="/">Sick Fits</Link>
        </Logo>
      </div>
      <div className="sub-bar">Search</div>
      <Nav />
    </header>
  );
}
